import React, { useState } from 'react';
import {
  Container,
  Paper,
  TextField,
  Button,
  Typography,
  Box,
  Alert,
  CircularProgress
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

const Login = ({ setUser }) => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const navigate = useNavigate();
  const API_BASE = 'http://localhost:5001';

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      console.log('Sending login request to:', `${API_BASE}/api/auth/login`);

      const response = await fetch(`${API_BASE}/api/auth/login`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          email: formData.email,
          password: formData.password
        }),
      });

      const data = await response.json();
      console.log('Login response:', data);

      if (data.success) {
        // ‚úÖ FIXED: Check different possible response structures
        const token = data.token || data.data?.token || data.accessToken;
        const user = data.user || data.data?.user;

        if (!token) {
          setError('No token received from server');
          setLoading(false);
          return;
        }

        // Save token and user to localStorage
        localStorage.setItem('accessToken', token);
        localStorage.setItem('user', JSON.stringify(user));
        setUser(user);

        // Debug logs
        console.log("Token received:", token);
        console.log("Token saved:", localStorage.getItem('accessToken'));
        console.log("User received:", user);

        // Redirect based on role using React Router
        switch (user?.role) {
          case 'admin':
            navigate('/admin');
            break;
          case 'faculty':
            navigate('/faculty');
            break;
          case 'student':
            navigate('/student');
            break;
          default:
            navigate('/dashboard');
        }
      } else {
        setError(data.message || 'Login failed');
      }
    } catch (err) {
      console.error('Login error:', err);
      setError('Login failed. Please check if backend server is running.');
    } finally {
      setLoading(false);
    }
  };

  const testBackend = async () => {
    try {
      const response = await fetch(`${API_BASE}/api/health`);
      const data = await response.json();
      alert(`‚úÖ Backend connected! ${data.message}`);
    } catch (error) {
      alert('‚ùå Backend connection failed! Make sure server is running on port 5001');
    }
  };

  return (
    <Container maxWidth="sm">
      <Box sx={{ mt: 8 }}>
        <Paper elevation={3} sx={{ p: 4 }}>
          <Typography variant="h4" align="center" gutterBottom>
            Smart Classroom Login
          </Typography>

          <Button 
            variant="outlined" 
            fullWidth 
            sx={{ mb: 2 }}
            onClick={testBackend}
          >
            Test Backend Connection
          </Button>

          {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

          <form onSubmit={handleSubmit}>
            <TextField
              fullWidth
              label="Email"
              variant="outlined"
              margin="normal"
              value={formData.email}
              onChange={(e) => setFormData({...formData, email: e.target.value})}
              required
              disabled={loading}
              placeholder="admin@college.edu"
            />

            <TextField
              fullWidth
              label="Password"
              type="password"
              variant="outlined"
              margin="normal"
              value={formData.password}
              onChange={(e) => setFormData({...formData, password: e.target.value})}
              required
              disabled={loading}
              placeholder="admin123"
            />

            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
              size="large"
              disabled={loading}
            >
              {loading ? <CircularProgress size={24} /> : 'LOGIN'}
            </Button>
          </form>

          <Typography variant="body2" color="textSecondary" align="center" sx={{ mt: 2 }}>
            Test Credentials:
          </Typography>
          <Typography variant="caption" display="block" align="center">
            Admin: admin@college.edu / admin123
          </Typography>

          <Box sx={{ mt: 2, p: 2, backgroundColor: '#f5f5f5', borderRadius: 1 }}>
            <Typography variant="body2" color="textSecondary" align="center">
              üí° Make sure your backend server is running on port 5001
            </Typography>
          </Box>
        </Paper>
      </Box>
    </Container>
  );
};

export default Login;
